import React from 'react';
import PageTitle from '../../common/PageTitle/PageTitle';
const Contact = () => (
    <div>
        <PageTitle>Contac </PageTitle>
        <p>Comapny Name</p>
        <p>Street number, street name</p>
        <p>Mobile number: xxx-xxx-xxx</p>
    </div>
)

export default Contact;
